package db.domain;import java.util.Arrays;public class LevelUpRewardImpl implements LevelUpReward {	@Key	private String uname;	@Key	private int level;	public LevelUpRewardImpl() {	}	public LevelUpRewardImpl(LevelUpReward c) {		this.uname = c.getUname();		this.level = c.getLevel();	}	@Override	public String tableName() {		return "level_up_reward";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setLevel(int level) {		this.level = level;	}	public int getLevel() {		return this.level;	}public void addLevel(int level) {		this.level += level;}}